import React from 'react';
import ListItem from './ListItem';
import styles from './List.module.scss';
import AppContext from '../../context';

const List = ({ items }) => (
    <>
    {items.length ? (
        <ul className={styles.wrapper}>
            {items.map(item => (
              <ListItem key={item.title} {...item} />
             ))}
        </ul>
    ) : (
        <AppContext.Consumer>
            {(context) => (
                <h1 class={styles.noItems}>There's nothing here yet, please add some con<span role="img" aria-label="Heart">❤️</span></h1>
            )}
        </AppContext.Consumer>
    )}
    </>
);

export default List;
